import React from "react";
import 'react-bulma-components/dist/react-bulma-components.min.css';
import { Navbar, Hero, Container } from 'react-bulma-components';
// import NavBar from "./components/NavBar";

class App extends React.Component {
    // constructor(props) {
    //     super(props);
    // }
    render() {
        return (
            <>
                <Navbar transparent={true}>
                    <Container>
                        <Navbar.Brand>
                            Andres Cordoba
                    </Navbar.Brand>
                        <Navbar position="start"></Navbar>
                        <Navbar.Menu position="end">
                            <Navbar.Item href="#" textAlignment="centered">
                                Skills
                            </Navbar.Item>
                            <Navbar.Item href="#" textAlignment="centered">
                                Projects
                            </Navbar.Item>
                            <Navbar.Item href="#" textAlignment="centered">
                                Contact
                    </Navbar.Item>
                        </Navbar.Menu>
                    </Container>
                </Navbar>
                <Hero fullheight="true" color="white">
                    <Hero.Body>
                        <Container>Hola</Container>

                    </Hero.Body>
                </Hero>
            </>
        );
    }
}

export default App;
